import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Navbar from "./components/Navbar";
import About from './components/About';
import Home from './components/Home';

function App() {
  return (
    <div>
      <Router>
    <Navbar/>
    <Switch>
          <Route  path="/about">
            <About/>
          </Route>
          <Route  path="/">
            <Home/>
          </Route>
        </Switch>
    </Router>
    </div>
  );
}

export default App;
